export enum DiscountType {
    PERCENTAGE = "PERCENTAGE",
    FLAT = "FLAT",
  }

  interface Seller {
    id: string;
    name: string;
    ifFlipkartAssured: boolean;
  }

  interface Discount {
    type: DiscountType;
    value: number;
  }

 export default interface ProductsListProps {
    id: string;
    name: string;
    description: string;
    seller: Seller;
    amount: number;
    discount: Discount;
    noOfStocksAvailable: number;
  }
